// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Bank {
    address public immutable admin;

    mapping(address => uint256) public balances;
    address[3] public topUsers;

    constructor() {
        admin = msg.sender;
    }

    // 允许直接收款
    receive() external payable {
        balances[msg.sender] += msg.value;
        _updateTopUsers(msg.sender);
    }

    // 仅管理员可提取合约余额
    function withdraw() external {
        require(msg.sender == admin, "Not authorized");
        payable(admin).transfer(address(this).balance);
    }

    // 获取前3名地址和对应余额
    function getTopUsers() external view returns (address[3] memory, uint256[3] memory) {
        return (
            topUsers,
            [balances[topUsers[0]], balances[topUsers[1]], balances[topUsers[2]]]
        );
    }

    // 私有函数：更新前3名用户
    function _updateTopUsers(address user) private {
        uint256 userBalance = balances[user];

        // 是否已在 topUsers 中
        for (uint i = 0; i < 3; i++) {
            if (topUsers[i] == user) {
                _sortTopUsers();
                return;
            }
        }

        // 找到余额最小的那个用户
        uint minIndex;
        for (uint i = 1; i < 3; i++) {
            if (balances[topUsers[i]] < balances[topUsers[minIndex]]) {
                minIndex = i;
            }
        }

        if (userBalance > balances[topUsers[minIndex]]) {
            topUsers[minIndex] = user;
            _sortTopUsers();
        }
    }

    // 私有函数：排序 topUsers（降序）
    function _sortTopUsers() private {
        for (uint i = 0; i < 2; i++) {
            for (uint j = i + 1; j < 3; j++) {
                if (balances[topUsers[j]] > balances[topUsers[i]]) {
                    (topUsers[i], topUsers[j]) = (topUsers[j], topUsers[i]);
                }
            }
        }
    }
}

